import React from 'react'

const Printer = (j) => {

  return (
    <div>
      {
        j.map((element, i) => {


          if (!firstUpdate && count === 0) {
            return <h3>{"Ei yhtään vitsiä"}</h3>

          }

          return <p>{i + 1}{". "}{element.joke}{"\n"}</p>
        }

        )
      }

    </div>
  )

}

export default Printer;
